import React from "react";
import { Link } from "react-router-dom";
import DownArrow from "../../Assets/Icons/DownArrow";
export default function filter() {
  return (
    <div className="flex min-w-[15rem] flex-col items-start justify-center  gap-3 bg-transparent ">
      <div className=" flex w-full items-center justify-between">
        <h1>Filter(0)</h1>
        <div className="  !border-b-transprent flex rounded-sm border-[3px] border-solid  border-transparent font-semibold leading-[2rem]   ">
          <Link
            to="/"
            className=" top-[.18rem] after:block after:h-[2.5px] after:w-0 after:bg-yellow-300 after:transition-width  hover:after:w-[5.2rem] hover:after:duration-300  "
          >
            Clear Filter
          </Link>
        </div>
      </div>
      <div className=" flex w-full items-center justify-between">
        {" "}
        <h1>Role</h1>
        <DownArrow />
      </div>
      <div className=" flex w-full items-center justify-between">
        <h1>Type</h1>
        <DownArrow />
      </div>
    </div>
  );
}
